			'<li>Offer flyers to anyone who is not buried in their phone or in a conversation<ul><li>For those who look busy, some truly are busy and some are trying to avoid you; don’t waste your energy!</li></ul></li> <li><strong>Be confident</strong>, friendly, and non-threatening</li> <li>Look directly at someone, ask them if they want a flyer or if you can give them one, and hold the flyer out toward them</li> <li><strong>“Can I get you a flyer?”</strong> is usually a better phrase than “Can I give you a flyer?”<ul><li>Psychologically, this may make them feel like you’re doing them a favor (and hey, maybe you are!)</li></ul></li> <li>However, when speaking to someone who appears to be very agreeable / nice / sweet:<ul><li>“Can I give you a flyer?” might be better, in the sense of asking for permission</li> <li>It’s good to speak a little softer and be a little more physically hesitant / sheepish / gentle while asking for permission</li> <li>Remember, to others, you are a stranger with an unknown agenda, and some people are more nervous to speak to you than you are to them!</li></ul></li> <li>If someone is approaching and makes eye contact when they are less than 5 seconds away, then keep <strong>eye contact</strong> with them until they are within flyer-offering distance<ul><li>If you look away, that lowers your apparent interest in them and they likewise won’t be interested in you; on the other hand, don’t just stare at people</li></ul></li> <li>Physical proximity matters; it’s best to just <strong>ignore people who are farther away</strong> (&gt;20ft or 6m) if you’re in a wide space<ul><li>You can’t physically reach them, and they might be intentionally avoiding you anyway; there are more fish in the sea!</li></ul></li> <li><strong>Don’t get in the way</strong> of passersby; you don’t need to do that to get the attention of the people you are trying to reach</li> <li>Find a balance between having conversations and handing out more flyers<ul><li>Having positive conversations can be very high-value</li> <li>If an interaction is going nowhere or is negative, it’s best to politely disengage and hand out more flyers</li></ul></li> <li><strong>Aim to inform, not to persuade</strong><ul><li>Don’t necessarily set out to change minds; many people would be concerned if they knew what you know, and many people are already concerned but don’t know what to do about it. <strong>Go find your people!</strong></li> <li>People tend to be curious when they hear that there is something that might affect them that they don’t know about</li></ul></li> <li><strong>Engage with empathy</strong><ul><li>Many people have worries about AI that aren’t the same as your own. Don’t try to change what they’re worried about. Instead, acknowledge their concerns and invite them into the broad umbrella of PauseAI: people who want to put a pause on AI and its risks.</li> <li>Try not to snatch defeat from the jaws of victory. <strong>Use “Yes And.”</strong> If they have real concerns about AI that seem too mild to you or seem to be focused on the wrong things, don’t communicate that they are <em>wrong</em>; communicate that they are <em>more right than they know</em>.</li></ul></li>',
